  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this report is to provide
  guidance relative to building capacity and geographically focusing efforts to implement
  landscape scale conservation (Strategic Habitat Conservation) throughout the country.
  In general, the framework would: (1) address terrestrial and aquatic species needs,
  as well as multiple ecosystems, (2) be accessible and transparent to employees and
  partners, (3) facilitate addressing complex conservation challenges, including accelerating
  climate change, and (4) provide a spatial framework to address activities in the
  context of higher level conservation goals.\",\n\t\"license_title\": \"License Not
